function Navbar() {
  return (
    //   make it sticky
      // has about, work, contact sections
    <nav>
        <ul>
            <li>
                <a href="#about">About</a>
            </li>
            <li>
                <a href="#work">Work</a>
            </li>
            <li>
                <a href="#contact">Contact</a>
            </li>
        </ul>
    </nav>
  );
}

export default Navbar;
